import React, { useState, useContext, useRef } from 'react';

import { Link } from 'react-router-dom';

import { Container, Project, PageTitle, ProjectTitle } from './styles';

function Projects() {

    return (
        <Container>
            <PageTitle>Projetos</PageTitle>

            <Project>
                <Link to={'/projects/chat'}><ProjectTitle>Chat em tempo real</ProjectTitle></Link>
            </Project>


        </Container>
    );
}

export default Projects;
